static const char __pyx_k_Get_minute_of_the_hour_componen[] = "\n        Get minute of the hour component of the Period.\n\n        Returns\n        -------\n        int\n            The minute as an integer, between 0 and 59.\n\n        See Also\n        --------\n        Period.hour : Get the hour component of the Period.\n        Period.second : Get the second component of the Period.\n\n        Examples\n        --------\n        >>> p = pd.Period(\"2018-03-11 13:03:12.050000\")\n        >>> p.minute\n        3\n        ";
static const char __pyx_k_Get_the_Timestamp_for_the_start[] = "\n        Get the Timestamp for the start of the period.\n\n        Returns\n        -------\n        Timestamp\n\n        See Also\n        --------\n        Period.end_time : Return the end Timestamp.\n        Period.dayofyear : Return the day of year.\n        Period.daysinmonth : Return the days in that month.\n        Period.dayofweek : Return the day of the week.\n\n        Examples\n        --------\n        >>> period = pd.Period('2012-1-1', freq='D')\n        >>> period\n        Period('2012-01-01', 'D')\n\n        >>> period.start_time\n        Timestamp('2012-01-01 00:00:00')\n\n        >>> period.end_time\n        Timestamp('2012-01-01 23:59:59.999999999')\n        ";
static const char __pyx_k_Get_the_hour_of_the_day_compone[] = "\n        Get the hour of the day component of the Period.\n\n        Returns\n        -------\n        int\n            The hour as an integer, between 0 and 23.\n\n        See Also\n        --------\n        Period.second : Get the second component of the Period.\n        Period.minute : Get the minute component of the Period.\n\n        Examples\n        --------\n        >>> p = pd.Period(\"2018-03-11 13:03:12.050000\")\n        >>> p.hour\n        13\n\n        Period longer than a day\n\n        >>> p = pd.Period(\"2018-03-11\", freq=\"M\")\n        >>> p.hour\n        0\n        ";
